import React, { useEffect, useState } from 'react';
import Navbar from '../components/Navbar';

export default function Dashboard() {
  const [resumo, setResumo] = useState(null);
  const [comunicacoes, setComunicacoes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [erro, setErro] = useState('');

  useEffect(() => {
    async function fetchDados() {
      setLoading(true);
      setErro('');
      try {
        const r1 = await fetch('http://localhost:8080/api/dashboard-resumo');
        const r2 = await fetch('http://localhost:8080/api/comunicacoes');
        const resumoData = await r1.json();
        const comunicacoesData = await r2.json();
        setResumo(resumoData);
        setComunicacoes(comunicacoesData);
      } catch (err) {
        setErro('Erro ao buscar dados do dashboard.');
      } finally {
        setLoading(false);
      }
    }
    fetchDados();
  }, []);

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-tl from-gray-600 via-gray-200 to-gray-100">
      <div className="w-full max-w-5xl mx-auto py-8 px-4">
        <Navbar />
        <h1 className="text-3xl font-bold text-blue-900 mb-6">Dashboard</h1>
        {loading && <div>Carregando...</div>}
        {erro && <div className="text-red-600 mb-4">{erro}</div>}
        {resumo && (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
            <div className="bg-white rounded shadow p-4">
              <div className="text-gray-500">Volume Analisado</div>
              <div className="text-2xl font-bold">R$ {resumo.volume_total?.toLocaleString('pt-BR')}</div>
            </div>
            <div className="bg-white rounded shadow p-4">
              <div className="text-gray-500">Comunicações</div>
              <div className="text-2xl font-bold">{resumo.num_comunicacoes}</div>
            </div>
          </div>
        )}
        <div className="bg-white rounded shadow p-4">
          <h2 className="text-xl font-bold mb-4">Comunicações</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full bg-white border rounded">
              <thead>
                <tr>
                  <th className="px-6 py-3 border whitespace-nowrap">Titular</th>
                  <th className="px-6 py-3 border whitespace-nowrap min-w-[140px]">CPF/CNPJ</th>
                  <th className="px-6 py-3 border whitespace-nowrap min-w-[180px]">Banco</th>
                  <th className="px-6 py-3 border whitespace-nowrap min-w-[170px]">Período</th>
                  <th className="px-6 py-3 border whitespace-nowrap min-w-[120px]">Valor</th>
                  <th className="px-6 py-3 border whitespace-nowrap">Ações</th>
                </tr>
              </thead>
              <tbody>
                {comunicacoes.map((c) => (
                  <tr key={c.id} className="hover:bg-blue-50">
                    <td className="px-6 py-2 border whitespace-nowrap">{c.titular}</td>
                    <td className="px-6 py-2 border whitespace-nowrap min-w-[140px]">{c.cpf}</td>
                    <td className="px-6 py-2 border whitespace-nowrap min-w-[180px]">{c.banco}</td>
                    <td className="px-6 py-2 border whitespace-nowrap min-w-[170px]">{c.periodo ? `${c.periodo.inicio || ''} - ${c.periodo.fim || ''}` : '-'}</td>
                    <td className="px-6 py-2 border whitespace-nowrap min-w-[120px]">R$ {c.valor?.toLocaleString('pt-BR')}</td>
                    <td className="px-6 py-2 border whitespace-nowrap">
                      <button className="bg-gray-400 text-white px-3 py-1 rounded cursor-not-allowed" disabled>Detalhes</button>
                    </td>
                  </tr>
                ))}
                {comunicacoes.length === 0 && (
                  <tr><td colSpan={6} className="text-center py-4 text-gray-500">Nenhuma comunicação encontrada.</td></tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}
